import s from './Game.module.css'
import {game} from "../tictactoe";

const Game = (props) => {
    return (
        <div>
            <button className={s.btn} onClick={() => game(props.id)} id={props.id}>
                {props.name}
            </button>
        </div>
    );
};

export default Game;
